// App.js
import { useState } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import { Line } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";
import L from "leaflet";

// ✅ Fix for missing Leaflet marker icons
import markerIcon2x from "leaflet/dist/images/marker-icon-2x.png";
import markerIcon from "leaflet/dist/images/marker-icon.png";
import markerShadow from "leaflet/dist/images/marker-shadow.png";

delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: markerIcon2x,
  iconUrl: markerIcon,
  shadowUrl: markerShadow,
});

// ✅ Register Chart.js modules
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

function App() {
  const [selectedStation, setSelectedStation] = useState(null);

  // Example stations
  const stations = [
    {
      name: "Kavaratti",
      lat: 10.567,
      lon: 72.633,
      tideData: [0.5, 1.2, 0.8, 1.6, 1.1, 0.7],
    },
    {
      name: "Chennai",
      lat: 13.1,
      lon: 80.3,
      tideData: [0.3, 0.9, 1.5, 1.2, 0.6, 0.4],
    },
    {
      name: "Kakinada",
      lat: 16.933,
      lon: 82.25,
      tideData: [1.0, 1.3, 0.9, 1.4, 0.8, 0.5],
    },
  ];

  // Chart data
  const chartData = selectedStation
    ? {
        labels: ["00:00", "04:00", "08:00", "12:00", "16:00", "20:00"],
        datasets: [
          {
            label: `Tide levels @ ${selectedStation.name}`,
            data: selectedStation.tideData,
            borderColor: "#3b82f6",
            backgroundColor: "rgba(59,130,246,0.2)",
          },
        ],
      }
    : null;

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-200 to-blue-500 text-gray-900">
      {/* Header */}
      <header className="p-6 text-center bg-yellow-300 text-black font-bold text-3xl shadow-md">
        🌊 Marinex – AI-Powered Tide & Float Analysis
      </header>

      {/* Stats Section */}
      <div className="grid grid-cols-2 md:grid-cols-4 gap-4 p-6">
        <div className="bg-white rounded-xl p-4 text-center shadow-md">
          <h2 className="text-lg">Active Stations</h2>
          <p className="text-2xl font-bold">{stations.length}</p>
        </div>
        <div className="bg-white rounded-xl p-4 text-center shadow-md">
          <h2 className="text-lg">Total Records</h2>
          <p className="text-2xl font-bold">27,450</p>
        </div>
        <div className="bg-white rounded-xl p-4 text-center shadow-md">
          <h2 className="text-lg">Recent Data</h2>
          <p className="text-2xl font-bold">27</p>
        </div>
        <div className="bg-white rounded-xl p-4 text-center shadow-md">
          <h2 className="text-lg">Avg Tide</h2>
          <p className="text-2xl font-bold">1.1m</p>
        </div>
      </div>

      {/* Main Layout */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6 p-6">
        {/* Map Section */}
        <div className="bg-white rounded-2xl shadow-lg overflow-hidden">
          <MapContainer
            center={[12.5, 80]}
            zoom={5}
            style={{ height: "500px", width: "100%" }}
          >
            <TileLayer
              attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a>'
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            />
            {stations.map((station, idx) => (
              <Marker
                key={idx}
                position={[station.lat, station.lon]}
                eventHandlers={{
                  click: () => setSelectedStation(station),
                }}
              >
                <Popup>{station.name}</Popup>
              </Marker>
            ))}
          </MapContainer>
        </div>

        {/* Details + Chart */}
        <div className="bg-white rounded-2xl shadow-lg p-6 flex flex-col">
          {selectedStation ? (
            <>
              <h2 className="text-xl font-semibold mb-2">
                {selectedStation.name}
              </h2>
              <p className="text-sm text-gray-600 mb-4">
                Lat: {selectedStation.lat}, Lon: {selectedStation.lon}
              </p>
              <div className="flex-1">
                <Line data={chartData} />
              </div>
            </>
          ) : (
            <p className="text-gray-500">
              🗺️ Click on a station marker to view tide details.
            </p>
          )}
        </div>
      </div>

      {/* AI Query Box */}
      <div className="p-6">
        <div className="bg-white rounded-2xl shadow-lg p-6">
          <h2 className="text-lg font-semibold mb-4">
            🤖 AI-Powered Query Interface
          </h2>
          <div className="flex gap-2">
            <input
              type="text"
              placeholder="e.g. Show stations closest to Mumbai"
              className="flex-1 p-2 rounded border border-gray-300"
            />
            <button className="bg-yellow-400 text-black font-bold px-4 py-2 rounded shadow hover:bg-yellow-300">
              Execute
            </button>
          </div>
          <p className="text-sm text-gray-500 mt-2">
            Try queries like: “Show tide levels for Chennai today”
          </p>
        </div>
      </div>
    </div>
  );
}

export default App;
